import { useState } from 'react';

const TextInput = (props) => {

  const [value, setValue] = useState("");

  return (
    <>
      <label className="flex flex-col mt-5" htmlFor="code">
        {props.label}
        <input className="border-gray-300 border focus:outline-none focus:ring-2 focus:ring-purple-600 rounded-lg px-2 py-1" type="text" name="code" value={value} onChange={e => setValue(e.target.value)}/>
      </label>
    </>
  );
};

export default TextInput;
